INSERT INTO `asteroid_implications` (`Asteroid_name`, `Atmospheric Entry`, `Energy`, `Global Damages`, `Crater`, `Ejecta`, `Thermal Radiation`, `Seismic Effects`, `Air Blast`, `Tsunami`) VALUES
('(2000 AF205)', '\r\nThe projectile begins to breakup at an altitude of 73700 meters = 242000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 6.27 km/s = 3.89 miles/s\r\nThe impact energy is 1.75 x 10^17 Joules = 4.19 x 10^1 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.46 km by 1.03 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 5.4 x 10^17 Joules = 1.29 x 10^2 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 3 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 1.64 km ( = 1.02 miles )\r\nTransient Crater Depth: 580 meters ( = 1900 feet )\r\nFinal Crater Diameter: 2.05 km ( = 1.27 miles )\r\nFinal Crater Depth: 437 meters ( = 1430 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 202 meters ( = 664 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.96 minutes after impact.\r\nRichter Scale Magnitude:  5.7\r\nMercalli Scale Intensity at a distance of 888 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 44.8 minutes after impact.\r\nPeak Overpressure: 215 Pa = 0.00215 bars = 0.0305 psi\r\nMax wind velocity: 0.505 m/s = 1.13 mph\r\nSound Intensity: 47 dB (Easily Heard)\r\n\r\n', NULL),
('(2000 UY33)', '\r\nThe projectile begins to breakup at an altitude of 73700 meters = 242000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 3.23 km/s = 2.01 miles/s\r\nThe impact energy is 2.04 x 10^16 Joules = 4.87 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.44 km by 1.02 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 2.36 x 10^17 Joules = 5.63 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.4 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nThe result of the impact is a crater field, not a single crater. The following dimensions are for the crater produced by the largest fragment.\r\nTransient Crater Diameter: 494 meters ( = 1620 feet )\r\nTransient Crater Depth: 175 meters ( = 573 feet )\r\nFinal Crater Diameter: 618 meters ( = 2030 feet )\r\nFinal Crater Depth: 132 meters ( = 431 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 61 meters ( = 200 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nMost ejecta is blocked by Earth\'s atmosphere.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.63 minutes after impact.\r\nRichter Scale Magnitude:  5.1\r\nMercalli Scale Intensity at a distance of 789 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 39.8 minutes after impact.\r\nPeak Overpressure: 117 Pa = 0.00117 bars = 0.0166 psi\r\nMax wind velocity: 0.276 m/s = 0.618 mph\r\nSound Intensity: 41 dB (Easily Heard)\r\n\r\n', NULL),
('(2005 LX36)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 10.7 km/s = 6.64 miles/s\r\nThe impact energy is 5.3 x 10^18 Joules = 1.27 x 10^3 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.957 km by 0.677 km', '\r\n\r\nEnergy before atmospheric entry: 5.61 x 10^18 Joules = 1.34 x 10^3 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 4.13 km ( = 2.57 miles )\r\nTransient Crater Depth: 1.46 km ( = 0.908 miles )\r\nFinal Crater Diameter: 5 km ( = 3.11 miles )\r\nFinal Crater Depth: 480 meters ( = 1580 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 7.18 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 5.31 microns ( = 0.209 thousandths of an inch )\r\nMean Fragment Diameter: 130 microns ( = 5.11 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.63 minutes after impact.\r\nRichter Scale Magnitude:  6.7\r\nMercalli Scale Intensity at a distance of 789 km:\r\n\r\nNothing would be felt.  Howev