('(2014 FP47)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 9.55 km/s = 5.93 miles/s\r\nThe impact energy is 5.33 x 10^17 Joules = 1.27 x 10^2 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.83 km by 0.587 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 7.07 x 10^17 Joules = 1.69 x 10^2 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 3.8 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 2.3 km ( = 1.43 miles )\r\nTransient Crater Depth: 812 meters ( = 2660 feet )\r\nFinal Crater Diameter: 2.87 km ( = 1.78 miles )\r\nFinal Crater Depth: 611 meters ( = 2000 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 283 meters ( = 929 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 3.33 minutes after impact.\r\nRichter Scale Magnitude:  6\r\nMercalli Scale Intensity at a distance of 999 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 50.5 minutes after impact.\r\nPeak Overpressure: 277 Pa = 0.00277 bars = 0.0394 psi\r\nMax wind velocity: 0.653 m/s = 1.46 mph\r\nSound Intensity: 49 dB (Easily Heard)\r\n\r\n', NULL),
