('(2019 RD)', '\r\nThe projectile begins to breakup at an altitude of 7210 meters = 23700 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 11 km/s = 6.81 miles/s\r\nThe impact energy is 9.18 x 10^19 Joules = 2.19 x 10^4 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 1.03 km by 0.726 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 9.24 x 10^19 Joules = 2.21 x 10^4 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2.9 x 10^5 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 9.31 km ( = 5.78 miles )\r\nTransient Crater Depth: 3.29 km ( = 2.04 miles )\r\nFinal Crater Diameter: 12.5 km ( = 7.77 miles )\r\nFinal Crater Depth: 633 meters ( = 2080 feet )\r\nThe crater formed is a complex crater.\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nThe ejecta will arrive approximately 6.07 minutes after the impact.\r\nAt your position there is a fine dusting of ejecta with occasional larger fragments.\r\nAverage Ejecta Thickness: 334 microns ( = 13.2 thousandths of an inch )\r\nMean Fragment Diameter: 737 microns ( = 29 thousandths of an inch )\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 1.95 minutes after impact.\r\nRichter Scale Magnitude:  7.5\r\nMercalli Scale Intensity at a distance of 585 km:\r\n\r\nFelt quite noticeably by persons indoors, especially on upper floors of buildings.  Many people do not recognize it as an earthquake.  Standing motor cars may rock slightly.  Vibrations similar to the passing of a truck.\r\n\r\nFelt indoors by many, outdoors by few during the day.  At night, some awakened.  Dishes, windows, doors disturbed; walls make cracking sound.  Sensation like heavy truck striking building.  Standing motor cars rocked noticeably.\r\n\r\n', '\r\nThe air blast will arrive approximately 29.5 minutes after impact.\r\nPeak Overpressure: 3200 Pa = 0.032 bars = 0.455 psi\r\nMax wind velocity: 7.44 m/s = 16.7 mph\r\nSound Intensity: 70 dB (Loud as heavy traffic)\r\n\r\n', NULL),
('(2019 SB10)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 8.43 km/s = 5.24 miles/s\r\nThe impact energy is 2.04 x 10^17 Joules = 4.87 x 10^1 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.812 km by 0.574 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 3.47 x 10^17 Joules = 8.28 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 2 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 1.81 km ( = 1.12 miles )\r\nTransient Crater Depth: 638 meters ( = 2090 feet )\r\nFinal Crater Diameter: 2.26 km ( = 1.4 miles )\r\nFinal Crater Depth: 480 meters ( = 1580 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 223 meters ( = 731 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nAlmost no solid ejecta reaches this site.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.62 minutes after impact.\r\nRichter Scale Magnitude:  5.7\r\nMercalli Scale Intensity at a distance of 787 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 39.7 minutes after impact.\r\nPeak Overpressure: 255 Pa = 0.00255 bars = 0.0362 psi\r\nMax wind velocity: 0.6 m/s = 1.34 mph\r\nSound Intensity: 48 dB (Easily Heard)\r\n\r\n', NULL),
('(2019 SH8)', '\r\nThe projectile begins to breakup at an altitude of 47100 meters = 154000 ft\r\nThe projectile reaches the ground in a broken condition.  The mass of projectile strikes the surface at velocity 6.98 km/s = 4.34 miles/s\r\nThe impact energy is 7.81 x 10^16 Joules = 1.87 x 10^1 MegaTons.\r\nThe broken projectile fragments strike the ground in an ellipse of dimension 0.803 km by 0.568 km\r\n', '\r\n\r\nEnergy before atmospheric entry: 1.94 x 10^17 Joules = 4.63 x 10^1 MegaTons TNT\r\n\r\nThe average interval between impacts of this size somewhere on Earth during the last 4 billion years is 1.2 x 10^4 years\r\n', '\r\nThe Earth is not strongly disturbed by the impact and loses negligible mass.\r\nThe impact does not make a noticeable change in the tilt of Earth\'s axis (< 5 hundredths of a degree).\r\nThe impact does not shift the Earth\'s orbit noticeably.\r\n', '\r\nCrater shape is normal in spite of atmospheric crushing; fragments are not significantly dispersed.\r\nTransient Crater Diameter: 1.43 km ( = 0.887 miles )\r\nTransient Crater Depth: 505 meters ( = 1660 feet )\r\nFinal Crater Diameter: 1.79 km ( = 1.11 miles )\r\nFinal Crater Depth: 380 meters ( = 1250 feet )\r\nThe crater formed is a simple crater.\r\nThe floor of the crater is underlain by a lens of broken rock debris (breccia) with a maximum thickness of 176 meters ( = 578 feet ).\r\nAt this impact velocity ( < 12 km/s), little shock melting of the target occurs.\r\n', '\r\nMost ejecta is blocked by Earth\'s atmosphere.\r\n', '\r\nAt this impact velocity ( < 15 km/s), little vaporization occurs; no fireball is created, therefore, there is no thermal radiation damage.\r\n\r\n', '\r\nThe major seismic shaking will arrive approximately 2.96 minutes after impact.\r\nRichter Scale Magnitude:  5.4\r\nMercalli Scale Intensity at a distance of 888 km:\r\n\r\nNothing would be felt.  However, seismic equipment may still detect shaking.\r\n\r\n\r\n', '\r\nThe air blast will arrive approximately 44.8 minutes after impact.\r\nPeak Overpressure: 163 Pa = 0.00163 bars = 0.0232 psi\r\nMax wind velocity: 0.385 m/s = 0.861 mph\r\nSound Intensity: 44 dB (Easily Heard)\r\n\r\n', NULL),
